import React, {Component} from 'react';

class Controls extends Component{
  render(){
    return(
      <div>
        <ul>
          <li>
            <a
              onClick={function(e){
                e.preventDefault();
                this.props.getControls(1);
              }.bind(this)}
              >Write
            </a>
          </li>
          <li><a>Modify</a></li>
          <li><a>Delete</a></li>
        </ul>
      </div>
    )
  }
}

export default Controls;
